import React from 'react';
import { NavLink } from 'react-router-dom';
import Contact from './Contact';
import About from './About';

export const Home = () => {
    return (
        <>
          
          <h1>I'm Home</h1>  
          <NavLink href='./About'>About</NavLink>
          <NavLink href='./Contact'>Contact</NavLink>
        </ >
       
    )
}

export default Home;
